public int compare(N o1, N o2) {
  int allocatedDiff = o1.getAllocatedResource()
      .compareTo(o2.getAllocatedResource());
  if (allocatedDiff == 0) {
    return o1.getNodeID().compareTo(o2.getNodeID());
  }
  return allocatedDiff;
}
